		function startVideoTracking() {
			if(data.trackinginterval) {
				return;
			}

			data.trackinginterval = setInterval(function() {
				var progress = parseInt((_getTime() / video.duration * 100), 10),
					progress_vw = parseInt((data.currentTimeWv / video.duration * 100), 10);

				lib.each(trackingEvents, function() {

					if(progress >= this.threshold && !this.sent && !this.wv) {
						this.sent = true;
						track(this.name, data.id);
					}

					if(progress_vw >= this.threshold && !this.sent && this.wv && data.options.threshold === 0) {
						this.sent = true;
						track(this.name, data.id);
					}
				});
			}, 300);
		}

