		function supportFullScreen() {
			return d.documentElement.requestFullscreen || d.documentElement.msRequestFullscreen || d.documentElement.mozRequestFullScreen || d.documentElement.webkitRequestFullscreen || false;
		}

		function toggleFullScreen(item, userAction) {
			if(!d.fullscreenElement && // alternative standard method
				!d.mozFullScreenElement && !d.webkitFullscreenElement && !d.msFullscreenElement) { // current working methods

				if(!item) {
					return;
				}

				if(userAction) {
					track("FULLSCREENON");
				}

				if(item.requestFullscreen) {
					item.requestFullscreen();
				} else if(item.msRequestFullscreen) {
					item.msRequestFullscreen();
				} else if(item.mozRequestFullScreen) {
					item.mozRequestFullScreen();
				} else if(item.webkitRequestFullscreen) {
					item.webkitRequestFullscreen(Element.ALLOW_KEYBOARD_INPUT);
				} else if(item.webkitEnterFullscreen) {
					item.webkitEnterFullscreen();
				}
			} else {

				if(userAction) {
					track("FULLSCREENOFF");
				}

				if(d.exitFullscreen) {
					d.exitFullscreen();
				} else if(d.msExitFullscreen) {
					d.msExitFullscreen();
				} else if(d.mozCancelFullScreen) {
					d.mozCancelFullScreen();
				} else if(d.webkitExitFullscreen) {
					d.webkitExitFullscreen();
				}
			}
		}


